import React from "react";

// core components
import MTGSpotsTable from "components/MTGTables/MTGSpotsTable.js";


function MTGSpotList(props) {

  return (
    <>
      <MTGSpotsTable {...props} handleSpotId={this.handleSpotId} />
    </>
  );

}

export default MTGSpotList;
